import React from "react";



const UserData =(props) => {
  return (
    <table className = "table table-hove">
    <thead>
    <tr>        
        <th>winner</th>
        <th>date</th>        
    </tr>
    </thead>
    <tbody>
    {
    props.data.map(row => (
        <tr>
            <td>{row.winner}</td>
    <td></td>
         </tr>
    ))
    }
    </tbody>


</table>

)
}






export default UserData;
